import React from 'react';
import "./index.css";
// import Cards from "./Cards";
// import Sdata from './Sdata';


const Sgames =()=>{
  let x = " 😄 "
  let y = " 😢 "
  let z = " 😄 "
 if (x===y && y===z){
   <h3>this is a match</h3>;
 } else (x === y && y === z)
}

const App = () => {
  return (
    <>
     <h1 className=" text-center m-3">🎰 Welcome To <span className=" text-center font-weight-bold">Slot Mathine Game</span>🎰</h1>
     <Sgames/>
    </>
  )
}

export default App;
